export default async function getEscalaAtualColaborador(numemp,tipcol,numcad) {
    var myHeaders = new Headers();
    myHeaders.append("X-Bpm-user", "jonathan.borba@alliar-homolog.com");
    myHeaders.append("Authorization", "bearer 4kJmuyUl0YnD4207dbDhAaDCzYyRGSJg");
    myHeaders.append("Content-Type", "application/json");

    var raw = JSON.stringify({
        numemp,tipcol,numcad
    });

    var requestOptions = {
        method: 'POST',
        headers: myHeaders,
        body: raw,
        redirect: 'follow'
    };

    fetch("https://portalrh.alliar.com:8183/SXI/G5Rest?module=rubi&service=com.senior.xplatform.bpm&server=https://portalrh.alliar.com:8183&port=consulta_colaboradores_escalas_transporte", requestOptions)
        .then(response => response.text())
        .then(result => console.log(result))
        .catch(error => console.log('error', error));
}
